// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "../EIP2981-implementation-main/contracts/ERC2981PerTokenRoyalties.sol";
import "../EIP2981-implementation-main/contracts/mocks/ERC1155WithRoyalties.sol";


contract MyToken is Ownable, ERC2981PerTokenRoyalties,ERC721URIStorage, ERC721Holder {
    using Counters for Counters.Counter;
    string public fileExtention = ".json";
    using Strings for uint256;
    string private tokenURL;
    uint256[] private tokenIds;
    address[] private royaltyFrom;
    address private compeny;
    uint256 tokenId;
    uint256 public allFee; // 10% == 10, 20% == 5 

    struct SallerInfo{
        address owner;
        uint256 price;
    }

    mapping(uint256 => SallerInfo) public sallerOwner;

    Counters.Counter private _tokenIdCounter;

    event NftSale(address to, uint256[] tokenIds);
    event KlayNftSale(address to, uint256 tokenIds, uint256 price);
    event KlayBatchNftSale(address to, uint256[] tokenIds, uint256 totalPrice);
    event RoyaltValues(uint256 royaltyFee, uint256 royaltyPrice);

    constructor() ERC721("MyToken", "MTK") {
        tokenIds.push(0);
        compeny = msg.sender;
        allFee = 1000;
        setApprovalForAll(address(this),true);
    }

    modifier isNftOwner(
        uint256[] memory _tokenIds,
        address _from
    ) 
    {
        for (uint i = 0; i < _tokenIds.length; i++) {
            require(
                ownerOf(_tokenIds[i]) == _from,
                "Only the owner can transfer this token"
            );
        }
        _;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721, ERC2981Base) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function setTokenURI(string memory _batchUri) public onlyOwner{
        tokenURL = _batchUri;
    }

    function setBatchUri() public view returns(string memory){
        return tokenURL;
    }

    // Check Writer Royalty
    function royalty(uint256 tokenid, uint256 price) private view returns(address to,uint256 ro){
        RoyaltyInfo memory royalties = _royalties[tokenid];
        address receiver = royalties.recipient;
        uint256 royaltyAmount = (price * royalties.amount) / 10000;
        return (receiver,royaltyAmount);
    }

    function safeMint(address to) public onlyOwner {
        tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        string memory tokenURIs = tokenURI(tokenId);
        _setTokenURI(tokenId, tokenURIs);

    }

    function ETHRoyaltySafeMint(address to, uint256 price, address royaltyRecipients, uint256 royaltyValues) public onlyOwner {
        tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        string memory tokenURIs = tokenURI(tokenId);
        _setTokenURI(tokenId, tokenURIs);
        tokenIds.push(tokenId);
        _setTokenRoyalty
        (
            tokenId,
            royaltyRecipients,
            royaltyValues
        );
        SallerInfo memory saller;
        saller.owner = msg.sender;
        saller.price = price;
        sallerOwner[tokenId] = saller;
    }

      function tokenURI(uint256 _tokenId) public view virtual override returns (string memory) {
        require(_exists(_tokenId), "ERC721Metadata: URI query for nonexistent token");
        string memory baseURI = setBatchUri();
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, _tokenId.toString(), fileExtention)) : "";
    }

    function batchMint(address to, uint amount) public onlyOwner{
        for (uint i = 0; i < amount; i++) {
            safeMint(to);
        }
    }

    function changePrice(
        address _to,
        uint256[] memory _tokenIds,
        uint256[] memory _rePrices
    )
    isNftOwner(_tokenIds,_to)
    public
    onlyOwner
    {
        for (uint i = 0; i < _rePrices.length; i++) {
            SallerInfo storage saller = sallerOwner[_tokenIds[i]];
            saller.price = _rePrices[i];
            saller.owner = _to;
        }
    }

    function batchTransferFrom(address from, address to, uint256[] memory ids) private {
        for (uint i = 0; i < ids.length; i++){
            require(_exists(ids[i]), "ERC721: nonexistent token");
            safeTransferFrom(from,to,ids[i]);
        }
        emit NftSale(to, ids);
    }

    function ownerBatchTransferFrom(address from, address to, uint256[] memory ids) public onlyOwner {
        for (uint i = 0; i < ids.length; i++){
            require(_exists(ids[i]), "KIP17: nonexistent token");
            safeTransferFrom(from,to,ids[i]);
        }
        emit NftSale(to, ids);
    }

    function tradeBatchTransferFrom(address _from, address _to, uint256[] memory _tokenIds) public onlyOwner{
        batchTransferFrom(_from, compeny, _tokenIds);
        batchTransferFrom(compeny, _to, _tokenIds);
        emit NftSale(_from, _tokenIds);
    }

    function ETHBatchMint(address to, uint amount, address[] memory royaltyRecipients, uint256[] memory royaltyValues, uint256[] memory price) public onlyOwner{

        require(price.length == amount , "ERC721: Arrays length mismatch");

        require(amount == royaltyRecipients.length &&
                amount == royaltyValues.length,
                'ERC721: Arrays length mismatch');

        for (uint i = 0; i < amount; i++) {
            ETHRoyaltySafeMint(to,price[i],royaltyRecipients[i],royaltyValues[i]);
        }

    }

    function ETHBatchTransferFrom(address from, address to, uint256[] memory ids) public payable {
        uint256 checkPrice;
        SallerInfo memory saller;

        for(uint256 j; j<ids.length; j++){
            saller = sallerOwner[ids[j]];
            checkPrice = saller.price + (saller.price * allFee / 10000);
            require(ownerOf(ids[j]) == compeny,"AndTreeMeta: This is an NFT that has been sold");
        }

        require(msg.value == checkPrice, "AndTreeMeta: not enough money1");

        for (uint i = 0; i < ids.length; i++){

            require(_exists(ids[i]), "AndTreeMeta: nonexistent token");
            saller = sallerOwner[ids[i]];
            RoyaltyInfo memory royalties = _royalties[ids[i]];
            address writerFrom;
            uint256 price; 
            uint256 fee = saller.price * allFee / 10000;
            (writerFrom,price) = royalty(ids[i],saller.price);
            uint256 salePrices = saller.price - price;

            // Writer
            (bool Writercheck ,) = payable(from).call{value : price}("");
            require(Writercheck,"ETH royaltyFee transfer failed");
            // saller
            (bool sallerCheck ,) = payable(saller.owner).call{value : salePrices}("");
            require(sallerCheck,"ETH salePrice transfer failed");
            // compeny
            (bool compenyCheck ,) = payable(compeny).call{value : fee}("");
            require(compenyCheck,"ETH fee transfer failed");
            emit RoyaltValues(royalties.amount, price);

            safeTransferFrom(from,to,ids[i]);
            emit RoyaltValues(royalties.amount, price);
        }
        emit KlayBatchNftSale(to,ids,checkPrice);
    }

    function ETHTradeBatchTransferFrom(address _from, uint256[] memory _tokenIds) public payable{
        uint256 checkPrice;
        SallerInfo memory saller;

        for(uint256 j; j<_tokenIds.length; j++){
            saller = sallerOwner[_tokenIds[j]];
            checkPrice = saller.price + (saller.price * allFee / 10000);
        }

        require(msg.value == checkPrice, "AndTreeMeta: not enough money2");

        batchTransferFrom(_from, compeny, _tokenIds);
        ETHBatchTransferFrom(compeny, msg.sender, _tokenIds);
    }

    function getToken() public view returns(uint256){
        return tokenIds.length - 1;
    }

    function recentTokenId() public view returns(uint256){
        uint256 max = tokenIds[0];
        for(uint256 i=1; i<tokenIds.length; i++){
                if(tokenIds[i] > max)
                    max = tokenIds[i];
        }
        return max;
    }

    function checkApproval(address operator) public view returns(bool){
        bool check = isApprovedForAll(compeny,operator);
        return check;

    }

    function setFee(uint256 fee) public onlyOwner {
        allFee = fee;
    }
